import React, { useState } from 'react';
import './RealEstateFinder.css';

const RealEstateFinder = () => {
  const [address, setAddress] = useState('');
  const [data, setData] = useState(null);

  const handleSearch = async () => {
    // Call to an external API to fetch home value/rental rates
    // Use a placeholder value for now
    const result = {
      homeValue: '$450,000',
      rentalRate: '$2,500/month',
    };
    setData(result);
  };

  return (
    <div className="real-estate-finder">
      <h3>Real Estate Finder</h3>
      <input
        type="text"
        value={address}
        onChange={(e) => setAddress(e.target.value)}
        placeholder="Enter your address"
      />
      <button onClick={handleSearch}>Find Home Value</button>
      {data && (
        <div className="result">
          <p>Home Value: {data.homeValue}</p>
          <p>Rental Rate: {data.rentalRate}</p>
        </div>
      )}
    </div>
  );
};

export default RealEstateFinder;
